1888","username":"vickyfleetwood_"},"is_video":false,"accessibility_caption":null,"edge_media_to_caption":{"edges":[{"node":{"text":"Who else is looking forward to gyms re-opening on 12th April?! \ud83d\ude4b\ud83c\udffc\u200d\u2640\ufe0f\n.\nBeing both a PT and athlete, I\u2019ve thought a lot about whether I\u2019d be comfortable wearing a face mask whilst training. I have a couple of concerns with this - breathability and sustainability. Luckily the @livinguardtech mask deals with both of these issues head on and I put it to the test on the bike and doing some of my favourite exercises.\n.\nThe mask is 5 x more breathable than cotton fabric, and it\u2019s fabric is treated with Livinguard Technology which destroys over 99.9% of all corona pathogens.\n.\nSecondly, regarding sustainability, one of my New Years resolutions was to take a more active stance on my personal impact on the planet. The reusable and self-sanitising nature of the product means that one mask could save up to 150 disposable ones before needing to be replaced! \ud83c\udf0e\n.\n#ad #staysafe #facemask #livinguardchallenge #livinguardtechnology #reusablemask"}}]},"edge_media_to_comment":{"count":14},"comments_disabled":false,"taken_at_timestamp":1614613519,"edge_liked_by":{"count":1308},"edge_media_preview_like":{"count":1308},"location":{"id":"213385402","has_public_page":true,"name":"London, United Kingdom","slug":"london-united-kingdom"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.90.720.720a/s640x640/153656125_801257337169890_1049316665040446424_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=4RLptIldY2oAX_wUAqm\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=a657e07134359a0f384c884b0734d26e\u0026oe=6070FBBA\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.90.720.720a/s150x150/153656125_801257337169890_1049316665040446424_n.jpg?tp=1\u0026_nc_ht=instagram.feo       request_url: errUrl.indexOf('direct') >= 0 ? 'direct' : errUrl,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
